import React from "react";
import { BrandStoryBannerWrapper,Header } from "./BrandStorybanner.styles";


export default function BrandStoryBanner(){
    return(
        <BrandStoryBannerWrapper>
           <Header>font-family: Montserrat;
  font-size: 45px;
  font-weight: bold;
  font-stretch: normal;
  font-style: normal;
  line-height: 1.33;
  letter-spacing: 4.5px;
  text-align: left;
  color: #fcd32a;</Header>
        </BrandStoryBannerWrapper>
    );

}
